var Projections = {
  createProj: function(epsg, extent) {
    var _proj;
    _proj = getProjection("EPSG:" + epsg);
    if (undefined !== extent) {
      _proj.setExtent(extent)
    }
    _proj.epsg = epsg;
    return _proj;
  }
}

